    <App  imsrc={im} name="Ali" />
    <App imsrc={im} name="Ahmad"/>
    <App imsrc={im} name="Razaq"/>
    <App  imsrc={im} name="chanda" />
    <App imsrc={im} name="faroo"/>
    <App imsrc={im} name="Razaq"/>

</span>
    , document.getElementById("root"));
